import React from "react";

import "./footer.styles.css";

const Footer = () => {
  return (
    <div className="footer__container">
      <div className="footer__subcontainer">
        <div>
          <h3>Get to Know Us</h3>
          <ul>
            <li>Careers</li>
            <li>Blog</li>
            <li>About Amazon</li>
            <li>Investor Relations</li>
            <li>Amazon Devices</li>
          </ul>
        </div>
        <div>Columna 2</div>
        <div>Columna 3</div>
        <div>Columna 4</div>
      </div>
    </div>
  );
};

export default Footer;
